import React from 'react';

function ShareBoard({ posts }) {
  return (
    <div>
      <h2>Partage des objectifs</h2>
      <ul>
        {posts.map((post, index) => (
          <li key={index}>{post}</li>
        ))}
      </ul>
    </div>
  );
}

export default ShareBoard;
